import React from 'react';

const Style = {
    github: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        marginLeft: 25
    }
};

function Project(props) {
    return (
        <div className="caseOne">
            <img src={props.project} alt="project img" />
            <div className="icons">
            </div>
            <div className="socials">
            </div>
        </div>
    );
}

export default Project;
